import React from 'react';
import Hero from '../Hero';
import Banner from '../Banner';
import { Link } from 'react-router-dom';

const Rooms = () => {
    return (
        <div>
            <Hero hero="roomsHero">
                <Banner title="ours rooms" subtitle="Hi, they have however at time of booking please make it a point to get a confirmation as such rooms are normally less in a hotel."  >
                    <Link to='/' className='btn-primary'> back home </Link>
                </Banner>
            </Hero>
        </div>
    );
};

export default Rooms;
